<script>
  var isPowerOfThree = function (n) {
   if (n <= 0) return false

   while (n % 3 == 0) {
     n = n / 3
   }
   return n == 1
  }
</script>

<script>
  var isPowerOfTwo = function (n) {
    if (n <= 0) return false

    while (n % 2 == 0) {
      n = n / 2
    }
    return n == 1
  }
</script>

<script>
  var trailingZeroes = function (n) {
      var fact = 1
      for (var i = 2; i <= n; i++) {
        fact *= i
      }

      var c = 0
      // n = 78020874200000000000000000
      while (fact) {
        var digit = fact % 10
        if (digit == 0) {
          c++
        } else {
          break
        }
        fact = fact / 10
      }

      return c
    };
</script>

<script>
  var reverse = function (x) {
      var sign = 1
      if (x < 0) {
        sign = -1
        x = -x
      }

      var result = 0
      while (x) {
        var digit = x % 10
        result = result * 10 + digit
        x = (x - digit) / 10
      }
      if (result > 2147483647) {
        return 0
      }

      return result * sign
    }
</script>

<script id="26">
  var removeDuplicates = function (nums) {
    const n = nums.length
    if (n === 0) {
      return 0
    }
    let fast = 1, slow = 1
    while (fast < n) {
      if (nums[fast] !== nums[fast - 1]) {
        nums[slow] = nums[fast]
        ++slow
      }
      ++fast
    }
    return slow
  }
</script>
